import styled from 'styled-components';

export const ButtonStyle = styled.div`
    /* display: flex;
    justify-content: center;
    align-items: center;
    flex-direction: column; */
    height:100vh;
    width: 100vw;
    
    .my-2{
        margin-top: 0 !important;
        box-shadow: 0px 5px 5px grey;
    }

    .buttons{
        display: flex;
        justify-content: center;
        align-items: center;
        margin-top: 10vh;
        margin-left:5vw;
    }
`;
